const Footer = () => {
  return (
    <footer style={{ backgroundColor: '#3B3F43', padding: '20px', textAlign: 'center',color: 'white' }}>
      <p><b>&copy; {new Date().getFullYear()} Nisarga Jamdhare . All Rights Reserved.</b></p>
    </footer>
  );
};

export default Footer;
